  const { dataProductsList } = useProducts();
  console.log("dataProductsList", dataProductsList);
  return (
    <Row>
      <Col span={6}>
        <Product />
      </Col>
      <Col span={6}>
        <Product />
      </Col>
      <Col span={6}>
        <Product />
      </Col>
      <Col span={6}>
        <Product />
      </Col>
    </Row>
  );
};

export default Products;
